import React from 'react';

const VideoItem = (props) => <li>

  <img src={props.video.snippet.thumbnails.medium.url}
  alt="video thumbnail" />

  <div>
    <p>
      {props.video.snippet.title}
    </p>
    <p>
      {props.video.snippet.chanelTitle}
    </p>
  </div>
</li>

export default VideoItem;
